import React from 'react';
import {logoColor} from '../img';

interface RegisterProp{
  showLogin: Function
}

export default class RegisterForm extends React.Component<RegisterProp>{
  render() {
    const { showLogin } = this.props
      return (
          <div className="shadow" onClick={()=> showLogin}>
          <div className="form">
            <header>
            <img className="logo" src={logoColor} alt="Logo"/>
              <h2>GET STARTED</h2>
              <p>By clicking button below you are agreeing you are having great time.
              And accepts some ours <a href="/terms">Terms.</a> and <a href="/terms">Cookie Polices</a></p>
            </header>
            <form>

            </form>
          </div>
          </div>
        )
    }
}
